import React from "react";
import ReactDOM from "react-dom";
import {
  Routes,
  Route
} from "react-router-dom";
import LetterContainer from "./Container"


const App = () => {
  return (
    <div>
      <Routes>
        <Route path = "/" element = {<LetterContainer/>}></Route>
      </Routes>
    </div>

  )
}

export default App
